import Api from './Api';
const list = () => Api.get(Api.url.positions)

//const get = (id) => Api.get(`$(Api.url.majors)/${id}`)

const update =(id,{a})=>Api.put(`$(Api.url.m)/${id}`,{a})
export default{
    list:list,
    //get:get
    update:update
};
